import React, { useEffect, useState } from "react";
import useAuth from "../hooks/useAuth";

function LogoutPage() {
  useEffect(() => {
    fetch("/logout")
      .then((res) => Response.json())
      .then((window.location.href = "/index"));
  }, []);
  return <div>LogoutPage</div>;
}

export default LogoutPage;
